import Header from './header';
import Head from 'next/head';
import { Container } from "react-bootstrap";
import "../styles/sass/header.scss";

const Layout =  (props:any) => {
    return(
        <div>
            <Head>
                <title>Meli</title>
            </Head>
            <Header></Header>
            <Container className="back">
                {props.children}
            </Container>
           
        </div>
    )

}
export default Layout;
